INSERT INTO `ps_product_lang` VALUES
(1084,1,1,'Damskie oprawki do okularów korekcyjnych Loro Eyewear DORIS  Przy pomocy konfiguratora z łatwością dodaj do swojego zamówienia soczewki okularowe, które zostaną wykonane na zamówienie w bezkonkurencyjnych cenach.   W zestawie z oprawkami LORO otrzymujesz gratis:  etui do okularów ściereczkę do czyszczenia okularów   Przy zakupie opraw okularowych z soczewkami korekcyjnymi montaż GRATIS.  Zamówienie opraw z soczewkami korekcyjnymi wydłuża czas oczekiwania na produkt do terminu widniejącego na karcie produktu wybranego typu soczewek.','','product-4968','','','','LORO DORIS damskie oprawki do okularów korekcyjnych','','','',''),
