(1135,1,1,'TECHNOLOGIA W PIĘKNEJ OPRAWIE  Oprawy korekcyjne marki Solano z nakładką przeciwsłoneczną wykonane z niesamowicie lekkiego materiału MONEL, odpornego na korozję. Łączą w sobie dwie funkcje - korekcję wzroku i profesjonalną ochronę przeciwsłoneczną. W nakładkach Clip-on zastosowano soczewki polaryzacyjne oraz filtry UV zapewniające 100% ochronę przed szkodliwym promieniowaniem słonecznym.    Oprawy korekcyjne z nakładką przeciwsłoneczną to rozwiązanie dla każdego, kto ceni praktyczność i wygodę. W jednej oprawie, za pomocą niewidocznych magnesów, połączono funkcję korekcji wady wzroku i profesjonalnej ochrony oczu przed promieniowaniem słonecznym oraz oślepiającymi refleksami świetlnymi.  W zestawie z oprawkami Solano Clip-on otrzymujesz gratis:  etui do okularów etui na nakładkę przeciwsłoneczną ściereczkę do czyszczenia okularów    Przy zakupie opraw okularowych z soczewkami korekcyjnymi montaż GRATIS.  Zamówienie opraw z soczewkami korekcyjnymi wydłuża czas oczekiwania na produkt do terminu widniejącego na karcie produktu wybranego typu soczewek.','','product-4777','','','','SOLANO CL 10176 oprawki okularowe z nakładką przeciwsłoneczną z polaryzacją Clip-On','','','',''),
