(1375,1,1,'Męskie oprawy korekcyjne marki Jens Hagen wykonane z odpornego na korozję monelu.  MINIMALIZM W NOWOCZESNYM WYDANIU  Tradycyjna stylistyka z domieszką nowoczesnej formy. Stonowana kolorystyka bez nadmiernych zdobień wpisuje się doskonale w klimat kolekcji. Przy pomocy konfiguratora z łatwością dodaj do swojego zamówienia soczewki okularowe, które zostaną wykonane na zamówienie w bezkonkurencyjnych cenach.  W zestawie z oprawkami Jens Hagen otrzymujesz:  etui do okularów    Przy zakupie opraw okularowych z soczewkami korekcyjnymi montaż GRATIS.  Zamówienie opraw z soczewkami korekcyjnymi wydłuża czas oczekiwania na produkt do terminu widniejącego na karcie produktu wybranego typu soczewek.','','product-4340','','','','Jens Hagen JH 20064 oprawki do okularów korekcyjnych','','','',''),
