(1438,1,1,'Oprawki do okularów korekcyjnych dla dzieci i młodzieży  Z8-Y40  Masz dość konieczności wymiany dziecięcych ramek, ponieważ zbyt łatwo się łamią? Zaprojektowane specjalnie dla nastolatków, oprawki Z8-Y40 są praktycznie niezniszczalne, zapewniają komfort w szkole i trwałość podczas zabawy.   Amerykańska marka Rec Specs to najwyższa jakość doceniona przez profesjonalnych sportowców na całym świecie, najbardziej rozsławiona przez koszykarzy NBA. Rec Specs Active to linia opraw do codziennego noszenia, dedytkowana aktywnym dzieciom i młodzieży w wieku szkolnym. Rozmiar 51 pasuje na młodzież i dorosłych o drobnej budowie twarzy. Rozmiar 54 pasuje na młodzież i dorosłych o regularnej budowie twarzy.   W zestawie półsztywne etui, ściereczka do czyszczenia i regulowany pasek.   Od prawie wieku producent Liberty Sport produkuje doskonałe oprawki i soczewki, które sprostają wymaganiom sportu. Najlepsze produkty, stworzone do pracy w trudnych warunkach, wyznaczają światowe standardy dla okularów sportowych i korekcyjnych. Zaangażowanie w badania i innowacje jest bezkonkurencyjne, od wiodącej ochrony przed uderzeniami ASTM F803 do innowacyjnych technologii przeciwsłonecznych.      Przy zakupie opraw okularowych z soczewkami korekcyjnymi montaż GRATIS.  Zamówienie opraw z soczewkami korekcyjnymi wydłuża czas oczekiwania na produkt do terminu widniejącego na karcie produktu wybranego typu soczewek.','','product-3519','','','','Rec Specs Active Z8-Y40 dziecięce oprawki do okularów korekcyjnych','','','',''),
