(1605,1,1,'Oprawa okularowa dla dzieci Como SOFT JUNIOR to produkt medyczny wykonany z termoplastycznego hipoalergicznego polimeru. Unikalna konstrukcja i całkowity brak metalowych części. Stworzona dla bezpieczeństwa i komfortu naszych dzieci.  Oprawka okularów korekcyjnych dla dzieci Como SOFT JUNIOR lekka i elastyczna pozwala na formowanie na gorąco. Zaprojektowana z myślą delikatnych twarzach wykonana z materiałów biomedycznych. Unikalna konstrukcja i całkowity brak części metalowych. Zaprojektowana w zgodzie z anatomią twarzy dziecka centralny mostek i szerokie tarcze pozwalają zachować naturalne, szerokie pole widzenia. Wykonana z hipoalergicznego polimeru. Włoskie oprawy Como pozwalają dzieciom codziennie stawiać czoła nowym wyzwaniom i bezpiecznie odkrywać świat. Dane techniczne:  Materiał – termoplastyczny hipoalergiczny polimer Elastyczny obrót o 360 stopni Unikalna konstrukcja i całkowity brak części metalowych Dopasowana gumka i etui w zestawie','','product-4869','','','','Soft junior','','','',''),
(1606,1,1,'Oprawa okularowa dla dzieci Como SOFT BABE to produkt medyczny wykonany z termoplastycznego hipoalergicznego polimeru. Dla bezpieczeństwa i komfortu naszych dzieci już od pierwszych miesięcy życia.  Oprawka okularów korekcyjnych dla dzieci Como SOFT BABE lekka i elastyczna pozwala na formowanie na gorąco. Zaprojektowana z myślą najdelikatniejszych buziach wykonana z materiałów biomedycznych. Unikalna konstrukcja i całkowity brak części metalowych. Zaprojektowana w zgodzie z anatomią twarzy dziecka centralny mostek i szerokie tarcze pozwalają zachować naturalne, szerokie pole widzenia. Wykonana z hipoalergicznego polimeru. Włoskie oprawy Como pozwalają dzieciom codziennie stawiać czoła nowym wyzwaniom i bezpiecznie odkrywać świat. Dane techniczne:  Materiał – termoplastyczny hipoalergiczny polimer Elastyczny obrót o 360 stopni Unikalna konstrukcja i całkowity brak części metalowych Dopasowana gumka i etui w zestawie','','product-4867','','','','Soft babe','','','',''),
(1607,1,1,'Oprawa okularowa dla dzieci Como SOFT NEWBORN to produkt medyczny wykonany z termoplastycznego hipoalergicznego polimeru. Dla bezpieczeństwa i komfortu naszych dzieci już od pierwszych dni życia.  Oprawka okularów korekcyjnych dla dzieci Como SOFT NEWBORN lekka i elastyczna pozwala na formowanie na gorąco. Zaprojektowana z myślą najdelikatniejszych buziach wykonana z materiałów biomedycznych. Unikalna konstrukcja i całkowity brak części metalowych. Zaprojektowana w zgodzie z anatomią twarzy dziecka centralny mostek i szerokie tarcze pozwalają zachować naturalne, szerokie pole widzenia. Wykonana z hipoalergicznego polimeru. Włoskie oprawy Como pozwalają dzieciom codziennie stawiać czoła nowym wyzwaniom i bezpiecznie odkrywać świat. Dane techniczne:  Materiał – termoplastyczny hipoalergiczny polimer Elastyczny obrót o 360 stopni Unikalna konstrukcja i całkowity brak części metalowych Dopasowana gumka i etui w zestawie','','product-4866','','','','Soft newborn','','','',''),
(1608,1,1,'Hipoalergiczne oprawki LL 2762 do okularów korekcyjnych polskiego producenta Liw Lewant. Doskonała powłoka ceramiczna zapewnia długotrwałe użytkowanie oprawy bez uszkodzeń lakieru. Wymienne zawiasy typu fleks pozwalają na łatwą naprawę oprawy w przypadku uszkodzenia zauszników. Możliwość zamówienia części zamiennych (prosimy o kontakt z obsługą klienta). Etui w komplecie.     Przy zakupie opraw okularowych z soczewkami korekcyjnymi montaż GRATIS.  Zamówienie opraw z soczewkami korekcyjnymi wydłuża czas oczekiwania na produkt do terminu widniejącego na karcie produktu wybranego typu soczewek.','','product-4848','','','','2762 Liw lewant dziecięce oprawki do okularów korekcyjnych','','','',''),
(1609,1,1,'Oprawy Milo&amp;Me zaprojektowano z myślą o najmłodszych. Są wyjątkowo lekkie, elastyczne i wytrzymałe. Oprawa wykonana jest z wytrzymałego, elastomerowego oraz pozbawionego plastyfikatorów TPE, zauszniki natomiast wykonane są z super wytrzymałego i elastycznego TR-90. Końcówki zauszników posiadają metalowy rdzeń, dzięki któremu możemy odpowiednio dopasować ich kształt. Specjalny materiał oraz konstrukcja znacznie zmniejszają ryzyko powstania ewentualnych obrażeń. Wykorzystana w zawiasach śruba z tuleją pozwala na długotrwałą pracę bez jej wymiany. Oprawy Milo&amp;Me pozbawione są dziecięcego designu dzięki czemu zachowują młodzieżowy, modny i atrakcyjny wygląd. Każda oprawa sprzedawana jest z elastyczną opaską, antypoślizgowymi końcówkami zauszników, woreczkiem z mikrofibry oraz etui.       Uwaga! Montaż soczewek należy przeprowadzać bez podgrzewania oprawy. Nie należy używać środków czyszczących zawierających rozpuszczalniki tłuszczu lub alkohol.(na przykład spirytus). Czyścić tylko letnią wodą.                         Przy zakupie opraw okularowych z soczewkami korekcyjnymi montaż GRATIS.   Zamówienie opraw z soczewkami korekcyjnymi wydłuża czas oczekiwania na produkt do terminu widniejącego na karcie produktu wybranego typu soczewek.','','product-4815','','','','Milo&Me Sara roz.38 dziecięce oprawki do okularów korekcyjnychdziecięce oprawki do okularów korekcyjnych','','','',''),
