(1620,1,1,'Bezpieczna oprawa korekcyjna dla dzieci.     oprawka wykonana z antyalergicznego, zastrzeżonego materiału SoftTouch, który spełnia wszystkie amerykańskie normy CPSIA i Prop 65 obejmujące produkty dla dzieci. Materiał ten jest niezwykle elastyczny, miękki i trwały, odporny na wszelkiego rodzaju uderzenia i pęknięcia zawias Intelliflex™ - zaprojektowany z możliwością zginania się zarówno w pionie, jak i w poziomie. Zawias IntelliFlex może „wrócić” do pierwotnego ustawienia, oferując wyjątkową elastyczność i większą trwałość zabudowany i wyprofilowany nosek oprawy zapewnia lepsze dopasowanie na nosie, a głębszy rowek w ramce zapewnia bezpieczeństwo soczewek    Idealne dla aktywnych dzieci, również do uprawiania sportów.  W zestawie: - kolorowe etui - 2 elastyczne gumeczki - ściereczka z mikrofibry    Przy zakupie opraw okularowych z soczewkami korekcyjnymi montaż GRATIS.   Zamówienie opraw z soczewkami korekcyjnymi wydłuża czas oczekiwania na produkt do terminu widniejącego na karcie produktu wybranego typu soczewek.','','product-4399','','','','Dilli Dalli roz. 49 BROWNIE dziecięce oprawki do okularów korekcyjnych','','','',''),
