(1654,1,1,'Oprawki do okularów korekcyjnych dla dzieci CLUTCH  Stworzone z myślą o aktywnych dzieciach, wykorzystują sportowe DNA marki Rec Specs. Oprawki CLUTCH są trwałe, stylowe i praktycznie niezniszczalne. CLUTCH jest częścią kolekcji oprawek Rec Specs Active i został zaprojektowany tak, aby wytrzymać codzienną, ponad przeciętnie intensywną ekspolatecję w szkole i podczas zabawy. To lekkie, hipoalergiczne okulary dla dzieci stworzone z myślą o całodziennym komforcie noszenia. Amerykańska marka Rec Specs to najwyższa jakość doceniona przez profesjonalnych sportowców na całym świecie, najbardziej rozsławiona przez koszykarzy NBA. Rec Specs Active to linia opraw do codziennego noszenia, dedytkowana aktywnym dzieciom i młodzieży w wieku szkolnym. Rozmiar 51 pasuje na dzieci w wieku od 8-13 lat.   W zestawie półsztywne etui, ściereczka do czyszczenia i regulowany pasek. Potrójny, metalowy zawias  Hipoalergiczne, 100% wolne od BPH. Bardziej odporne na zarysowania niż oprawy z acetatu czy wtrysku nylonowego.   Od prawie wieku producent Liberty Sport produkuje doskonałe oprawki i soczewki, które sprostają wymaganiom sportu. Najlepsze produkty, stworzone do pracy w trudnych warunkach, wyznaczają światowe standardy dla okularów sportowych i korekcyjnych. Zaangażowanie w badania i innowacje jest bezkonkurencyjne, od wiodącej ochrony przed uderzeniami ASTM F803 do innowacyjnych technologii przeciwsłonecznych.      Przy zakupie opraw okularowych z soczewkami korekcyjnymi montaż GRATIS.  Zamówienie opraw z soczewkami korekcyjnymi wydłuża czas oczekiwania na produkt do terminu widniejącego na karcie produktu wybranego typu soczewek.','','product-3559','','','','Rec Specs Active CLUTCH dziecięce oprawki do okularów korekcyjnych','','','',''),
