(1695,1,1,'Wygodne, lekkie, elastyczne i odporne oprawki dla dzieci.  Oprawki dziecięce Centrostyle Active Spring Lekka oprawka z materiału Grilamid TR90 z anatomicznym mostkiem dla utrzymania prawidłowego środka optycznego. Zauszniki zostały wykonane z miękkiej gumy w technologii podwójnego wtrysku dla zwiększenia komfortu oraz optymalnego dopasowania do głowy dziecka.  Oprawki Centrostyle Active Spring mają owalny kształt, aby zapewnić jak największe pole widzenia.   Dostępna w dwóch rozmiarach i siedmiu kolorach.  Szczegóły:  nisko osadzony mostek zauszniki obejmujące głowę podtrzymująca opaska silikonowa zapewnia właściwe umiejscowienie oprawy na twarzy dziecka   W zestawie z oprawkami Active Spring otrzymujesz gratis:  opaskę silikonową woreczek z mikrofibry twarde etui   Ramka spełnia następujące Unijne normy dotyczące bezpieczeństwa zabawek:EN 71-3:1994 / A1: 2000 / AC: 2000 / AC: 2002:\"Migracja z materiału\" i EN 71-9:2005 + A1: 2007:\"Organiczne związki chemiczne: monomery, rozpuszczalniki, plastyfikatory\".  Oznacza to, że oprawa jest bezpieczna w przypadku gryzienia przez dziecko. Została przetestowana dermatologicznie (nie powoduje podrażnień skóry).UWAGA! Opraw Active Spring nie należy podgrzewać ani czyścić środkami na bazie alkoholu.    Przy zakupie opraw okularowych z soczewkami korekcyjnymi montaż GRATIS.  Zamówienie opraw z soczewkami korekcyjnymi wydłuża czas oczekiwania na produkt do terminu widniejącego na karcie produktu wybranego typu soczewek.','','product-1377','','','','Active Spring Oval  dziecięce oprawki do okularów korekcyjnych','','','',''),
(1696,1,1,'Wygodne, elastyczne i odporne oprawki dziecięce.  Oprawa \"jednoczęściowa\" dla dzieci wykonana metodą wtrysku z materiałów gumowych o różnych gęstościach: wysokiej gęstości gumy na zewnątrz aby zachować kształt oprawy, oraz mniejszej gęstości gumy wewnątrz, aby zapewnić większy stopień komfortu. Brak zawiasów i innych części metalowych gwarantuje wysoką ochronę i zapobiega pękaniu i deformacji.  Szczegóły:  nisko osadzony mostek zauszniki obejmujące głowę podtrzymująca opaska silikonowa zapewnia właściwe umiejscowienie oprawy na twarzy dziecka   W zestawie z oprawkami Active Baby Soft otrzymujesz gratis:  opaskę silikonową woreczek z mikrofibry twarde etui   Ramka spełnia następujące Unijne normy dotyczące bezpieczeństwa zabawek:EN 71-3:1994 / A1: 2000 / AC: 2000 / AC: 2002:\"Migracja z materiału\" i EN 71-9:2005 + A1: 2007:\"Organiczne związki chemiczne: monomery, rozpuszczalniki, plastyfikatory\".  Oznacza to, że oprawa jest bezpieczna w przypadku gryzienia przez dziecko. Została przetestowana dermatologicznie (nie powoduje podrażnień skóry).  Przy zakupie opraw okularowych z soczewkami korekcyjnymi montaż GRATIS.  Zamówienie opraw z soczewkami korekcyjnymi wydłuża czas oczekiwania na produkt do terminu widniejącego na karcie produktu wybranego typu soczewek.','','product-1343','','','','Active Baby Soft dziecięce oprawki do okularów korekcyjnych','','','',''),
