(1708,1,1,'Bezpieczna oprawa korekcyjna dla dzieci w wieku 4-6 lat Oprawy pozbawione metalowych części i zawiasów minimalizują ryzyko urazów twarzy i oczu. Odporne na wszelkie uszkodzenia mechaniczne mogące powstawać w trakcie użytkowania. Anatomicznie zaprojektowany mostek rozkłada ciężar soczewek okularowych i oprawy na dużą powierzchnię, zwiększając komfort noszenia okularów. Wyjątkowo lekki, elastyczny i giętki materiał umożliwia optymalne dopasowanie oprawy do twarzy dziecka, co pozwala na wczesną korekcję wad refrakcji i leczenie zeza. Regulowana elastyczna opaska umożliwia stabilne ułożenie oprawy.  Idealne dla małych dzieci, doskonałe dla uprawiających sport.  W zestawie: - etui - elastyczna gumka w kolorze oprawy  Przy zakupie opraw okularowych z soczewkami korekcyjnymi montaż GRATIS.   Zamówienie opraw z soczewkami korekcyjnymi wydłuża czas oczekiwania na produkt do terminu widniejącego na karcie produktu wybranego typu soczewek.','','product-873','','','','Miraflex Mayan 2 - dziecięce oprawki do okularów korekcyjnych','','','',''),
(1709,1,1,'TECHNOLOGIA W PIĘKNEJ OPRAWIE  Oprawy korekcyjne marki Solano z nakładką przeciwsłoneczną wykonane z niesamowicie wytrzymałego ULTEMU. Łączą w sobie dwie funkcje - korekcję wzroku i profesjonalną ochronę przeciwsłoneczną. W nakładkach Clip-on zastosowano soczewki polaryzacyjne oraz filtry UV zapewniające 100% ochronę przed szkodliwym promieniowaniem słonecznym.     model CL30006 A, C i D z powłoką Mirror HD  *   *   * Oprawki z serii Solano Sport idealnie sprawdzą się w codziennym użytkowaniu a dzięki sportowemu profilowi również na rower czy do biegania.  Oprawki nie nadają się do sportów kontaktowych, zespołowych, tenisa, wf-u i tym podobnych.   W zestawie z oprawkami Solano Clip-on otrzymujesz gratis:  etui do okularów etui na nakładkę przeciwsłoneczną ściereczkę do czyszczenia okularów    Przy zakupie opraw okularowych z soczewkami korekcyjnymi montaż GRATIS.  Zamówienie opraw z soczewkami korekcyjnymi wydłuża czas oczekiwania na produkt do terminu widniejącego na karcie produktu wybranego typu soczewek.','','product-837','','','','SOLANO CL 30006 oprawki okularowe z nakładką przeciwsłoneczną z polaryzacją Clip-On','','','',''),
