(1722,1,1,'Okulary ochronne Rec Specs RS-40 do uprawiania sportu z możliwością montażu szkieł korekcyjnych.    Amerykańska marka Rec Specs to najwyższa jakość doceniona przez profesjonalnych sportowców na całym świecie, najbardziej rozsławiona przez koszykarzy NBA.    Spełnia lub przewyższa standard odporności na uderzenia ASTM F803 dla sportów kontaktowych.   Opatentowana konstrukcja tarczy okularów (patent # 6,890,073) w parze ze sportową krzywizną bazową 6, pozwala na szeroki zakres mocy soczewek korekcyjnych.   Wykonane z nylonu, materiału o wysokiej odporności na uderzenia -zapewnia oprawie elastyczność i wytrzymałość. Dopasowuje się do geometrii twarzy, idealnie współgrając z nią podczas wysiłku fizycznego. Nie ma mowy o efekcie dyskomfortu wywołanego sztywnością konwencjonalnych okularów sportowych, nawet w najbardziej dynamicznych sytuacjach.   Miękka wyściółka zauszników i amortyzacja wyściółki wokół oczu zapewnia ochronę i komfort.   W zestawie: półsztywne etui i ściereczka do czyszczenia.   Od prawie wieku producent Liberty Sport produkuje doskonałe oprawki i soczewki, które sprostają wymaganiom sportu. Najlepsze produkty, stworzone do pracy w trudnych warunkach, wyznaczają światowe standardy dla okularów sportowych i korekcyjnych. Zaangażowanie w badania i innowacje jest bezkonkurencyjne, od wiodącej ochrony przed uderzeniami ASTM F803 do innowacyjnych technologii przeciwsłonecznych.      Przy zakupie opraw okularowych z soczewkami korekcyjnymi montaż GRATIS.  Zamówienie opraw z soczewkami korekcyjnymi wydłuża czas oczekiwania na produkt do terminu widniejącego na karcie produktu wybranego typu soczewek.','','product-3528','','','','Rec Specs RS-40 okulary sportowe do korekcji','','','',''),
