(1725,1,1,'Okulary sportowe dla dzieci Sziols INDOOR KIDS do uprawiania sportu z możliwością montażu szkieł korekcyjnych. Okulary sportowe INDOOR Kids zostały opracowane specjalnie z myślą o dzieciach. Dzięki wykorzystaniu zaawansowanych technologii, okulary INDOOR Kids spełniają najwyższe normy bezpieczeństwa i zapewniają użytkownikom nieograniczoną swobodę INDOOR Kids idealnie sprawdzają się w każdych sportach (szczególnie zespołowych), na lekcjach W-Fu oraz wszędzie tam gdzie wada wzroku uniemożliwia pełnię satysfakcji z codziennej aktywności fizycznej. Nauczyciele i trenerzy są zgodni: okulary INDOOR Kids powinny być obecne na lekcjach wychowania fizycznego. Lepsze wyniki oraz poczucie bezpieczeństwa to podstawa.  Gładkie, ergonomiczne ochraniacze silikonowe zapewniają potrójną ochronę przed uderzeniami bocznymi \"Dobierz soczewki\" korekcyjne przy pomocy przycisku po prawej stronie. Polecamy wybór soczewek do okularów sportowych np. z bardzo wytrzymałego materiału Trivex dla zwiększenia bezpieczeństwa. Zakres montażu soczewek korekcyjnych: od+6,00 do -8,00 dpt cyl do 4,00 dpt  unikalna technologia - brak metalu, brak odprysków, boczne kanały wentylacyjne umożliwiające przepływ powietrza i ochronę przed parowaniem elastyczna opaska na głowę pomaga zapewnić idealne dopasowanie wysokogatunkowe, odporne na pęknięcia szkła poliwęglanowe (bez korekcji) 100% ochrona UV nowoczesny design oprawek szeroki wybór kolorów najwyższe normy bezpieczeństwa  Okulary spełniają najwyższe normy bezpieczeństwa: rekomendacja Bawarskiego ministerstwa Edukacji i Kultury, certyfikacja TÜV.   W zestawie z okularami Sziols INDOOR otrzymujesz:  twarde etui silikonowe ochraniacze ściereczkę z mikrofibry    Przy zakupie opraw okularowych z soczewkami korekcyjnymi montaż GRATIS. Zamówienie opraw z soczewkami korekcyjnymi wydłuża czas oczekiwania na produkt do terminu widniejącego na karcie produktu wybranego typu soczewek.  Przy pomocy konfiguratora z łatwością dodaj do swojego zamówienia soczewki okularowe, które zostaną wykonane na zamówienie w bezkonkurencyjnych cenach.','','product-2402','','','','Sziols INDOOR KIDS dziecięce okulary sportowe do korekcji','','','',''),
