(1728,1,1,'Okulary ochronne dla dzieci BETTY do uprawiania sportu z możliwością montażu szkieł korekcyjnych.   Amerykańska marka Rec Specs to najwyższa jakość doceniona przez profesjonalnych sportowców na całym świecie, najbardziej rozsławiona przez koszykarzy NBA    Spełnia lub przewyższa standard odporności na uderzenia ASTM F803 dla sportów kontaktowych. Opatentowana konstrukcja tarczy okularów (patent # 6,890,073) w parze ze sportową krzywizną bazową 6, pozwala na szeroki zakres mocy soczewek korekcyjnych. Oprawa wykonana z mięsistego bardzo trwałego tworzywa, które dopasowuje się do geometrii twarzy, idealnie współgrając z nią podczas wysiłku fizycznego. Nie ma mowy o efekcie dyskomfortu wywołanego sztywnością konwencjonalnych okularów sportowych, nawet w najbardziej dynamicznych sytuacjach. Szeroka elastyczna guma stabilizująca okulary na głowie. Mostek posiada miękką, dopasowaną kolorystycznie wyściółkę zapewniającą wygodę i dopasowanie. W zestawie półsztywne etui, ściereczka do czyszczenia i regulowany pasek.   Od prawie wieku producent Liberty Sport produkuje doskonałe oprawki i soczewki, które sprostają wymaganiom sportu. Najlepsze produkty, stworzone do pracy w trudnych warunkach, wyznaczają światowe standardy dla okularów sportowych i korekcyjnych. Zaangażowanie w badania i innowacje jest bezkonkurencyjne, od wiodącej ochrony przed uderzeniami ASTM F803 do innowacyjnych technologii przeciwsłonecznych.      Przy zakupie opraw okularowych z soczewkami korekcyjnymi montaż GRATIS.  Zamówienie opraw z soczewkami korekcyjnymi wydłuża czas oczekiwania na produkt do terminu widniejącego na karcie produktu wybranego typu soczewek.','','product-1848','','','','Rec Specs BETTY okulary sportowe do korekcji','','','',''),
