(1734,1,1,'Profesjonalne okulary sportowe Leader C2 M korekcji. Super twardy materiał nylonowy oprawy sprawia, iż są ekstremalnie wytrzymałe i zarazem bardzo lekkie. *   *   * Produkt zawiera soczewki demontracyjne, które nie nadają się do użytkowania. Okulary Leader wymagają montażu soczewek korekcyjnych. Można zamówić również soczewki bez korekcji tzw. \"zerówki\". Rekomendowany zakres oszklenia okularów sportowych ochronnych Leader od +/- 6,00 dpt. z cyl. do +/- 2,00 dpt. *   *   *  Specjalnie zaprojektowany i opatentowany rowek SpinGuard pod montaż soczewek sprawia, że okulary z zamontowanymi soczewkami korekcyjnymi spełniają normy bezpieczeństwa EN-166, zapewniając maksymalne bezpieczeństwo.   Okulary sportowe korekcyjne Leader C2 posiadają bardzo przydatną opcję noszenia pod kaskiem sportowym. Przeznaczone do uprawiania sportów kontaktowych oraz do sportów takich jak tenis, squash, volleyball i wielu innych.       SPECYFIKACJA    Przeznaczone do uprawiania sportów kontaktowych oraz sportów takich jak tenis, squash, volleyball, baseball (rozm. S i XS) i wielu innych.                               Najważniejsze cechy:   Sposoby noszenia: Opcja 1 – zauszniki z opaską na głowę (w komplecie) Opcja 2 – opaska na głowę zamiast zauszników Opcja 3 – opaska pod kask sportowy    W zestawie:    etui woreczek z mikrofibry opaska na głowę osłony skroni','','product-216','','','','LEADER C2 M okulary sportowe do korekcji','','','',''),
