(1736,1,1,'Profesjonalne okulary sportowe dla dzieci Leader C2 XS do korekcji. Super twardy materiał nylonowy oprawy sprawia, iż są ekstremalnie wytrzymałe i zarazem bardzo lekkie.  *   *   * Produkt zawiera soczewki demontracyjne, które nie nadają się do użytkowania. Okulary Leader wymagają montażu soczewek korekcyjnych. Można zamówić również soczewki bez korekcji tzw. \"zerówki\". Rekomendowany zakres oszklenia okularów sportowych ochronnych Leader od +/- 6,00 dpt. z cyl. do +/- 2,00 dpt. *   *   *  Specjalnie zaprojektowany i opatentowany rowek SpinGuard pod montaż soczewek sprawia, że okulary z zamontowanymi soczewkami korekcyjnymi spełniają normy bezpieczeństwa EN-166, zapewniając maksymalne bezpieczeństwo.   Okulary sportowe korekcyjne Leader C2 posiadają bardzo przydatną opcję noszenia pod kaskiem sportowym. Przeznaczone do uprawiania sportów kontaktowych oraz do sportów takich jak tenis, squash, volleyball i wielu innych. Dlaczego warto nosić okulary sportowe na WF?  Okulary sportowe to doskonała propozycja dla każdego dziecka, które ma wadę wzroku i aktywnie uczestniczy w lekcjach WF-u lub innych zajęciach sportowych. Okulary sportowe na WF to przede wszystkim dbałość o bezpieczeństwo Twojego dziecka. Uprawianie jakiegokolwiek sportu w tradycyjnych okularach korekcyjnych może się wiązać ze sporym ryzykiem, ponieważ takie modele nie są odporne na uderzenia i mechaniczne urazy. Treningi bez okularów z kolei zdecydowanie osłabiają zaangażowanie i skuteczność dziecka. Okulary sportowe to obowiązkowy element w przypadku sportów kontaktowych, takich jak piłka nożna, siatkówka czy piłka ręczna, ale również wszędzie tam, gdzie liczy się precyzja.        SPECYFIKACJA    Przeznaczone do uprawiania sportów kontaktowych oraz sportów takich jak tenis, squash, volleyball, baseball (rozm. S i XS) i wielu innych.                               Najważniejsze cechy:   Sposoby noszenia: Opcja 1 – zauszniki z opaską na głowę (w komplecie) Opcja 2 – opaska na głowę zamiast zauszników Opcja 3 – opaska pod kask sportowy    W zestawie:    etui woreczek z mikrofibry opaska na głowę osłony skroni','','product-213','','','','LEADER C2 XS okulary sportowe do korekcji','','','',''),
(1737,1,1,'Profesjonalne okulary sportowe Leader ProX L do korekcji. Super twardy materiał nylonowy oprawy sprawia, iż są ekstremalnie wytrzymałe i zarazem bardzo lekkie. *   *   * Produkt zawiera soczewki demontracyjne, które nie nadają się do użytkowania. Okulary Leader wymagają montażu soczewek korekcyjnych. Można zamówić również soczewki bez korekcji tzw. \"zerówki\". Rekomendowany zakres oszklenia okularów sportowych ochronnych Leader od +/- 6,00 dpt. z cyl. do +/- 2,00 dpt.  *   *   * Specjalnie zaprojektowany i opatentowany rowek SpinGuard pod montaż soczewek sprawia, że okulary z zamontowanymi soczewkami korekcyjnymi spełniają normy bezpieczeństwa EN-166, zapewniając maksymalne bezpieczeństwo. Posiadają różne opcje noszenia oraz bogate wyposażenie.  Przeznaczone do uprawiania sportów kontaktowych oraz do sportów takich jak tenis, squash, volleyball i wielu innych.       SPECYFIKACJA    Przeznaczone do uprawiania sportów kontaktowych oraz do sportów takich jak koszykówka, piłka nożna, squash, volleyball i wielu innych.                         Najważniejsze cechy:   W zestawie:  etui woreczek z mikrofibry opaska na głowę gumka do zauszników osłony boczne do samodzielnego montażu wymienne wkładki chroniące nos','','product-211','','','','LEADER ProX L okulary sportowe do korekcji','','','',''),
