(1740,1,1,'LEADER SPIRIT Okulary sportowe z wkładką korekcyjną. Leader Spirit to idealne rozwiązanie dla tych, którzy cenią sobie uniwersalność i dynamikę.  Zdecydowany sportowy charakter podkreślają zaokrąglony kształt okularów oraz ostro zakończona soczewka. Podnoszone, zaokrąglone, szerokie soczewki doskonale chronią przed wiatrem i pyłem w części skroniowej, dzięki czemu okulary są dobrą propozycją dla kolarzy.  Nasadka poliwęglanowa z funkcją unoszenia „Flip-up” doskonale sprawdza się podczas biegania przełajowego, jazdy na rowerze w trudnym, błotnistym terenie i innych sportów, w których występuje nagła zmiana oświetlenia lub dochodzi do częstego zachlapania soczewek uniemożliwiającego kontynuację zawodów. Nanośniki oraz końcówki zauszników wykonane są z miękkiej gumy, gwarantując wygodę użytkowania okularów. Dodatkowo, w zestawie dostępne są wymienne końcówki nanośników i  zauszników dla wydłużenia czasu wygodnego użytkowania. Soczewki zapewniają 100% ochronę przed promieniowaniem UV-A i UV-B do 400 nm, dzięki czemu korzystanie z okularów jest całkowicie bezpieczne. Okulary wyposażone są we wkładkę korekcyjną o krzywiźnie bazowej 6 do bezproblemowego montażu soczewek korekcyjnych.  SPECYFIKACJA    wkładka z bazą 6 do indywidualnego oszklenia od +/– 4,00 dpt. z cyl. +/– 2,00 dpt. poliwęglanowa nasadka (soczewka) typu „Flip-up”   Okulary przeznaczone są sportów rowerowych, biegania oraz do sportów outdoorowych.           W zestawie:   etui woreczek z mikrofibry wkładka korekcyjna nasadka typu „Flip-up” zestaw wymiennych gumek    Opcja korekcji wzroku za pomocą wkładki korekcyjnej. Wkładka korekcyjna Leader Spirit służy do montażu soczewek korekcyjnych w celu aktywnego korzystania z okularów sportowych przez osoby z wadą wzroku. Wkładkę korekcyjną montuje się za pomocą zatrzasku. Wystarczy wsunąć wkładkę w szczelinę w okularach i gotowe. Dzięki mocnemu połączeniu z okularami wkładka pozostaje na swoim miejscu nawet przy wzmożonej aktywności np. jeździe górskiej na rowerze, bieganiu przełajowym.  Rekomendowany zakres oszklenia: od +/- 4,00 dpt. z cyl. do +/- 2,00 dpt   Akcesoria dodatkowe   Dostępne w osobnej sprzedaży.','','product-191','','','','LEADER SPIRIT okulary sportowe z możliwością korekcji','','','',''),
(1741,1,1,'LEADER TRACKER Okulary sportowe z korekcją wzroku, którą montuje się w oprawę przy pomocy wkładki korekcyjnej lub specjalnych adapterów. Tracker to okulary o typowo sportowym charakterze. Szerokie soczewki chronią przed wiatrem i refleksami światła w części skroniowej, dzięki czemu okulary są dobrą propozycją dla kolarzy lub lekkoatletów.  Regulowane nanośniki oraz końcówki zauszników są wymienne (dostępne oddzielnie). Wykonane są z miękkiej gumy, gwarantując wygodę użytkowania okularów. Soczewki zapewniają 100% ochronę przed promieniowaniem UV-A i UV-B do 400 nm, dzięki czemu korzystanie z okularów jest całkowicie bezpieczne. Okulary wyposażone są w wyjmowane adaptery o bazie 6 do bezproblemowego montażu soczewek korekcyjnych.  SPECYFIKACJA   Dwie opcje soczewek: Baza 6 – adaptery do indywidualnego oszklenia od +/– 4,00 dpt. z cyl. +/– 2,00 dpt. Baza 8 – oprawa z soczewkami bez korekcji (opcjonalnie, soczewki do zamówienia osobno)  Okulary przeznaczone są sportów rowerowych, biegania oraz do sportów outdoorowych.           W zestawie:   etui woreczek z mikrofibry adaptery korekcyjne   Opcja korekcji wzroku za pomocą adapterów. Adaptery Leader Tracker służą do montażu soczewek korekcyjnych w celu aktywnego korzystania z okularów sportowych przez osoby z wadą wzroku.  Adapter wystarczy wcisnąć w okulary umieszczając kolejno krawędzie adapteru w okularach. Dzięki mocnemu połączeniu z oprawą adapter staje się integralną częścią okularów.  Rekomendowany zakres oszklenia adapterów: od +/- 4,00 dpt. z cyl. do +/- 2,00 dpt Soczewki korekcyjne z barwieniem możesz dobrać osobno. Dostępne również soczewki barwione z polaryzacją - bez korekcji.   Akcesoria dodatkowe   Dostępne w osobnej sprzedaży.','','product-184','','','','LEADER TRACKER okulary sportowe z możliwością korekcji','','','',''),
(1742,1,1,'LEADER HORIZON Okulary sportowe z korekcją wzroku, którą montuje się w oprawę za pomocą specjalnych adapterów. Horizon to oryginalna propozycja dla wszystkich sportowców. Posiadają nowoczesny kształt oraz zachowaną w sportowym stylu kolorystykę. Nanośniki oraz końcówki zauszników wykonane są z miękkiej gumy, gwarantując wygodę użytkowania okularów. Soczewki zapewniają 100% ochronę przed promieniowaniem UV-A i UV-B do 400 nm, dzięki czemu korzystanie z okularów jest całkowicie bezpieczne. W zestawie dostępne są dodatkowe soczewki przeciwsłoneczne w kolorze pomarańczowym, który zwiększa kontrast widzenia. Dwa rodzaje adapterów (niski - w zestawie, wysoki - do zamówienia osobno) oraz niska waga sprawiają, że okulary są idealne do sportów lekkoatletycznych.   SPECYFIKACJA   Dwie opcje soczewek: Baza 6 – 2 rodzaje adapterów do indywidualnego oszklenia od +/– 4,00 dpt. z cyl. +/– 2,00 dpt. (niski - w zestawie, wysoki - do zamówienia osobno) Baza 8 – oprawa z soczewkami bez korekcji (opcjonalnie, soczewki z polaryzacją do zamówienia osobno, pomarańczowe w zestawie)  Okulary przeznaczone są sportów rowerowych, biegania oraz do sportów outdoorowych.           W zestawie:  etui woreczek z mikrofibry adaptery korekcyjne soczewki w kolorze pomarańczowym do umieszczenia bezpośrednio w okularach (bez adapterów) - zapewniają zwiększony kontrast widzenia    Opcja korekcji wzroku za pomocą adapterów. Adaptery Leader Horizon służą do montażu soczewek korekcyjnych w celu aktywnego korzystania z okularów sportowych przez osoby z wadą wzroku.  Adapter wystarczy wcisnąć w okulary. Demontaż adapteru z soczewką wykonujemy przy użyciu specjalnej szczeliny do demontażu po wewnętrznej stronie okularów. Dzięki mocnemu połączeniu z oprawą adapter staje się integralną częścią okularów.  Dwie opcje adapterów (niski i wysoki) Rekomendowany zakres oszklenia adapterów: od +/- 4,00 dpt. z cyl. do +/- 2,00 dpt Soczewki korekcyjne z barwieniem możesz dobrać osobno. Dostępne również soczewki barwione z polaryzacją - bez korekcji.      Akcesoria dodatkowe   Dostępne w osobnej sprzedaży.','','product-167','','','','LEADER HORIZON okulary sportowe z możliwością korekcji','','','',''),
