(1750,1,1,'Soczewki plastikowe z podstawowym antyrefleksem ułatwiającym czyszczenie w idneksie 1.5 o standardowej grubości.  Podstawowa powłoka antyrefleksyjna w atrakcyjnej cenie. Dodatkowa powłoka oleofobowa ułatwiająca utrzymanie okularów w czystości. Eliminują odbicia światła, dzięki temu do oka dociera prawie 100 % światła widzialnego. Większa przejrzystość i lepszy kontrast. Redukują zmęczenie oczu spowodowane przez sztuczne źródła światła, pracę przy komputerze. Cena dotyczy szkieł magazynowych: od -6,0 do +3,75 cyl. 4,0 Dobre rozwiązanie przy małych i średnich wadach wzroku.   cena za parę soczewek (2 szt.)   Przy zakupie opraw okularowych z soczewkami korekcyjnymi montaż GRATIS. Zamówienie opraw z soczewkami korekcyjnymi wydłuża czas oczekiwania na produkt do terminu widniejącego na karcie produktu wybranego typu soczewek.','','product-68','','','','JZO Praktis 150 SHMC cyl. do 4 soczewki okularowe z antyrefleksem','','','',''),
