(1754,1,1,'Przejrzyste soczewki do okularów Essilor Orma 1.5 o standardowej grubości, z niezwykle łatwą w czyszczeniu powłoką antyrefleksyjną Crizal ROCK.  Odporność na zarysowania, również podczas wycierania czy upuszczania okularów.  Redukcja odblasków dla wyraźnego widzenia. Odpychanie kurzu i wody, a także odporność na smugi dla szkieł, które pozostają przejrzyste, tak jak pierwszego dnia Najbardziej wszechstronna i codzienna ochrona przed niewidocznymi i często nieodwracalnymi zagrożeniami związanymi z odbiciem promieni UV.  cena za parę soczewek (2 szt.)  Przy zakupie opraw okularowych z soczewkami korekcyjnymi montaż GRATIS.    Zamówienie opraw z soczewkami korekcyjnymi wydłuża czas oczekiwania na produkt do terminu widniejącego na karcie produktu wybranego typu soczewek.','','product-30','','','','Essilor Orma 1,5 Crizal ROCK szkła z antyrefleksem do okularów korekcyjnych','','','',''),
(1755,1,1,'ŹRÓDŁA ŚWIATŁA NIEBIESKIEGOŚwiatło niebieskie jest emitowane przez ekrany urządzeń cyfrowych, takich jak:  smartfony, tablety, laptopy, telewizory, oświetlenie LED  Coraz częstsze korzystanie przez nas z tego typu urządzeń, a co za tym idzie coraz dłuższa, bezpośrednia ekspozycja wzroku na światło niebieskie sprawia, że staje się ono realnym zagrożeniem dla naszego wzroku. DZIAŁANIE OKULARÓW Z POWŁOKĄ IDEAL MAX® BLUE UV   Powłoka Ideal Max® Blue UV redukuje przechodzenie światła niebieskiego przez soczewkę okularową. Dodatkowo chroni też wzrok przed promieniami ultrafioletowymi, zapobiegając ich odbijaniu się od wklęsłej powierzchni soczewki.    Soczewka okularowa z powłoką Ideal Max® Blue UV charakteryzuje się indeksem E-SPF 25.E-SPF 25 oznacza, że wzrok użytkownika w soczewkach jest chroniony przed UV 25 razy bardziej, niż bez soczewek.   Cena obejmuje montaż 2 szt. przy zakupie opraw w naszym sklepie internetowym.','','product-72','','','','JZO Izoplast 150 M Ideal Max Blue UV','','','',''),
