(1822,1,1,'Damskie okulary przeciwsłoneczne Dekoptica SUN m. 48 z dodatkową opcją montażu soczewek korekcyjnych z barwieniem. Wyposażone w soczewki z filtrem UV (bez korekcji) zapewniające 100% ochronę przed szkodliwym promieniowaniem słonecznym. Dobierz korekcyjne soczewki barwione przy pomocy przycisku \"Dobierz soczewki\".   W zestawie z okularami Dekoptica otrzymujesz gratis:  etui do okularów ściereczkę do czyszczenia okularów  Dlaczego warto wybrać oprawki Dekoptica?  Dekoptica to polska marka wysokiej klasy oprawek do okularów korekcyjnych i przeciwsłonecznych. Znajdziesz tu wiele stylowych i designerskich okularów, które wyraźnie nawiązują do światowych trendów. Wszystkie okulary przeciwsłoneczne posiadają odpowiednie filtry chroniące przed szkodliwym promieniowaniem UV, które również eliminują odblaski świetlne. Oprawki Dekoptica to połączenie niezwykłej funkcjonalności oraz ciekawego wzornictwa. Szkła polaryzacyjne, stosowane przez tę markę, polecane są osobom cierpiącym na nadwrażliwość na promienie słoneczne.    Przy zakupie opraw okularowych z soczewkami korekcyjnymi montaż GRATIS.  Zamówienie opraw z soczewkami korekcyjnymi wydłuża czas oczekiwania na produkt do terminu widniejącego na karcie produktu wybranego typu soczewek.','','product-2373','','','','Dekoptica SUN m. 48 okulary przeciwsłoneczne z możliwością korekcji','','','',''),
