(1925,1,1,'Okulary przeciwsłoneczne z polaryzacją ALTITUDE z magnetycznymi, wymiennymi soczewkami  ALTITUDE łączy odważną stylizację ze świetnym dopasowaniem. Sportowy profil, szeroki zausznik i duże  soczewki zapewniają maksymalną ochronę przed niekorzystnymi warunkami atmosferycznymi, idealny wybór do uprawiania sportów, w których wiatr i słońce stanowią największe wyzwanie. W połączeniu z opatentowaną technologią wymiany soczewek magnetycznych SWITCH™, ALTITUDE bezkonkurencyjnie dostosowuje się do zmiennych warunków oświetleniowych, zachowując przy tym wysoką jakość widzenia.  Magnetyczny system wymiany soczewek — Switch wykorzystuje wysokoenergetyczne magnesy osadzone w soczewce i oprawce, aby umożliwić użytkownikom szybką i łatwą wymianę soczewek w miarę zmiany warunków oświetleniowych i aktywności.  Żeglarstwo, jazda samochodem, wędkarstwo, polowanie, motocykl, strzelanie Zestaw z dwoma parami wymiennych soczewek zawiera:  oprawę z magnesami    jedną parę szarych soczewek polaryzacyjnych z niebieską powłoką lustrzaną, oraz powłoką antyrefleksyjną po wewnętrznej stronie soczewek    jedną parę soczewek bursztynowych do zastosowania w słabych warunkach oświetleniowych    woreczek z mikrofibry    twarde etui na soczewki','','product-3609','','','','Switch ALTITUDE okulary przeciwsłoneczne z wymiennymi soczewkami','','','',''),
