(2033,1,1,'Okulary przeciwsłoneczne z polaryzacją AXO z magnetycznymi, wymiennymi soczewkami  Okulary Axo Rx są przykładem dążenia do ciągłego doskonalenia produktów marki Switch. Dzięki pełnej oprawie w stylu sportowym okulary idealnie dopasowują się do większości kształtów twarzy, zarówno  męskich jak i damskich. Zoptymalizowana pod względem masy oprawa z wtryskiwanego nylonu okala głowę, zapewniając lepsze widzenie peryferyjne i ochronę przed światłem odbitym, wiatrem i zanieczyszczeniami. Tekstury 3D na nanośnikach i końcówkach zauszników, zapewniają lepszą przyczepność przy zmniejszonych punktach nacisku, gwarantując trwały komfort. Sportowe okulary przeciwsłoneczne Axo to produkt uniwersalny, idealny zarówno do górskich wycieczek, biegania, jazdy rowerem oraz pozostałych aktywności fizycznych na wolnym powietrzu.   Zestaw z dwoma parami wymiennych soczewek zawiera:  oprawę z magnesami    jedną parę szarych soczewek polaryzacyjnych z niebieską powłoką lustrzaną, oraz powłoką antyrefleksyjną po wewnętrznej stronie soczewek    jedną parę soczewek bursztynowych do zastosowania w słabych warunkach oświetleniowych    twardy futerał    woreczek z mikrofibry     twarde etui na soczewki   Magnetyczny system wymiany soczewek — Switch wykorzystuje wysokoenergetyczne magnesy osadzone w soczewce i oprawce, aby umożliwić użytkownikom szybką i łatwą wymianę soczewek, gdy zmieniają się warunki oświetleniowe i aktywność.','','product-3087','','','','Switch AXO okulary przeciwsłoneczne z wymiennymi soczewkami','','','',''),
(2034,1,1,'Okulary przeciwsłoneczne z polaryzacją H-Wall Sweptback z magnetycznymi, wymiennymi soczewkami  zostały nazwane na cześć trasy narciarskiej Black Diamond w Tahoe, gdzie widoczność dramatycznie spada po południu, gdy słońce chowa się za górą. Aby poprawić widoczność, szybka wymiana soczewki na żółtą z maksymalnym kontrastem sprawi, że warunki na trasie nie będą stanowiły problemu. Sportowa, okalająca głowę konstrukcja okularów przeciwsłonecznych do sportów zimowych H-Wall  zapobiega przedostawaniu się światła. Wentylowane noski poprawiają przepływ powietrza, aby zminimalizować parowanie soczewek. Zauszniki tych sportowych okularów przeciwsłonecznych są anatomicznie ukształtowane i otoczone gumą, aby zapewnić bezpieczne i wygodne dopasowanie.  Zestaw z dwoma parami wymiennych soczewek zawiera:  oprawę z magnesami    jedną parę szarych soczewek polaryzacyjnych z niebieską powłoką lustrzaną, oraz powłoką antyrefleksyjną po wewnętrznej stronie soczewek    jedną parę soczewek bursztynowych do zastosowania w słabych warunkach oświetleniowych    twardy futerał    woreczek z mikrofibry     twarde etui na soczewki   Magnetyczny system wymiany soczewek — Switch wykorzystuje wysokoenergetyczne magnesy osadzone w soczewce i oprawce, aby umożliwić użytkownikom szybką i łatwą wymianę soczewek, gdy zmieniają się warunki oświetleniowe i aktywność.','','product-3081','','','','Switch H-WALL SWEPT BACK okulary przeciwsłoneczne z wymiennymi soczewkami','','','',''),
