(2043,1,1,'LEADER TRAIL Okulary sportowe z korekcją wzroku, którą montuje się w oprawę przy pomocy wkładki korekcyjnej. Leader Trail to produkt dla miłośników ruchu. Ich uniwersalny, lekko zaokrąglony kształt oraz ciekawa kolorystyka przypadną do gustu wielu sportowcom, a szczególnie tym, którym zależy na dobrym wyglądzie. W zestawie dodatkowe soczewki w kolorze pomarańczowym, które zwiększają kontrast widzenia. Nanośniki oraz końcówki zauszników wykonane są z miękkiej gumy, gwarantując wygodę użytkowania okularów. Soczewki zapewniają 100% ochronę przed promieniowaniem UV-A i UV-B do 400 nm, dzięki czemu korzystanie z okularów jest całkowicie bezpieczne. Okulary wyposażone są we wkładkę korekcyjną o krzywiźnie bazowej 6 do bezproblemowego montażu soczewek korekcyjnych.  SPECYFIKACJA    wkładka z bazą 6 do indywidualnego oszklenia od +/– 4,00 dpt. z cyl. +/– 2,00 dpt.   Okulary przeznaczone są sportów rowerowych, biegania oraz do sportów outdoorowych.           W zestawie:   etui woreczek z mikrofibry wkładka korekcyjna wymienne soczewki w kolorze pomarańczowym    Opcja korekcji wzroku za pomocą wkładki korekcyjnej. Wkładka korekcyjna Leader Trail służy do montażu soczewek korekcyjnych w celu aktywnego korzystania z okularów sportowych przez osoby z wadą wzroku. Wkładkę korekcyjną montuje się za pomocą zatrzasku. Wystarczy wsunąć wkładkę w szczelinę w okularach i gotowe. Dzięki mocnemu połączeniu z okularami wkładka pozostaje na swoim miejscu nawet przy wzmożonej aktywności np. jeździe górskiej na rowerze, bieganiu przełajowym.  Rekomendowany zakres oszklenia: od +/- 4,00 dpt. z cyl. do +/- 2,00 dpt   Akcesoria dodatkowe   Dostępne w osobnej sprzedaży.','','product-194','','','','LEADER TRAIL okulary sportowe z możliwością korekcji','','','',''),
(2044,1,1,'LEADER FLASH Okulary sportowe z korekcją wzroku, którą montuje się w oprawę przy pomocy wkładki korekcyjnej. Leader Flash to idealne rozwiązanie dla tych, którzy cenią sobie uniwersalność i dynamikę.  Podnoszone, zaokrąglone, szerokie soczewki doskonale chronią przed wiatrem i pyłem w części skroniowej, dzięki czemu okulary są dobrą propozycją dla kolarzy.   Nasadka poliwęglanowa z funkcją unoszenia „Flip-up” doskonale sprawdza się podczas biegania przełajowego, jazdy na rowerze w trudnym, błotnistym terenie i innych sportów, w których występuje nagła zmiana oświetlenia lub dochodzi do częstego zachlapania soczewek uniemożliwiającego kontynuację zawodów. W zestawie dodatkowa soczewka w kolorze pomarańczowym, która zwiększa kontrast widzenia. Nanośniki oraz końcówki zauszników wykonane są z miękkiej gumy, gwarantując wygodę użytkowania okularów. Soczewki zapewniają 100% ochronę przed promieniowaniem UV-A i UV-B do 400 nm, dzięki czemu korzystanie z okularów jest całkowicie bezpieczne. Okulary wyposażone są we wkładkę korekcyjną o krzywiźnie bazowej 6 do bezproblemowego montażu soczewek korekcyjnych.  SPECYFIKACJA     wkładka z bazą 6 do indywidualnego oszklenia od +/– 4,00 dpt. z cyl. +/– 2,00 dpt. poliwęglanowa nasadka (soczewka) typu „Flip-up”   Okulary przeznaczone są sportów rowerowych, biegania oraz do sportów outdoorowych.           W zestawie:   etui woreczek z mikrofibry wkładka korekcyjna nasadka typu „Flip-up” wymienna nasadka typu „Flip-up” w kolorze pomarańczowym    Opcja korekcji wzroku za pomocą wkładki korekcyjnej. Wkładka korekcyjna Leader Flash służy do montażu soczewek korekcyjnych w celu aktywnego korzystania z okularów sportowych przez osoby z wadą wzroku. Wkładkę korekcyjną montuje się za pomocą zatrzasku. Wystarczy wsunąć wkładkę w szczelinę w okularach i gotowe. Dzięki mocnemu połączeniu z okularami wkładka pozostaje na swoim miejscu nawet przy wzmożonej aktywności np. jeździe górskiej na rowerze, bieganiu przełajowym.  Rekomendowany