(2048,1,1,'Okulary ochronne z możliwością korekcji Uniwersalne okulary ochronne marki Shoptic o modnym kształcie z osłonami bocznymi i podwójnym mostkiem.  Oprawy są wyposażone w bezbarwne soczewki poliwęglanowe. Możliwość montażu szkieł korekcyjnych.  99,5% ochrona UV do 370nm','','product-292','','','','Okulary ochronne metalowe z możliwością korekcji','','','',''),
(2049,1,1,'Okulary ochronne z możliwością korekcji Wysokiej jakości męskie oprawy ochronne marki Infield z możliwością montażu soczewek korekcyjnych. Wyposażone w osłonę boczną wykonaną z poliwęglanu. Okulary posiadają bezbarwne, utrwardzane, poliwęglanowe soczewki. Możliwość montażu szkieł korekcyjnych.  99,5% ochrona UV do 370nm','','product-291','','','','Okulary ochronne metalowe z możliwością korekcji','','','',''),
(2050,1,1,'Okulary ochronne z możliwością korekcji Solidne, uniwersalne okulary ochronne marki Infield z możliwością oszklenia.  Wyposażone w zintegrowane transparentne osłony na skroniach oraz zauszniki z regulacją długości i kąta nachylenia. Okulary posiadają bezbarwne soczewki utwardzone wykonane z poliwęglanu. Możliwość montażu szkieł korekcyjnych.  99,5% ochrona UV do 370nm  Do czego służą okulary ochronne korekcyjne?  Okulary ochronne mają zapewnić optymalne bezpieczeństwo w czasie pracy w niebezpiecznych warunkach. Sprawdzają się wszędzie tam, gdzie należy chronić oczy przed takimi zagrożeniami jak promieniowanie optyczne, uderzenia mechaniczne czy zapylenie. Okulary ochronne muszą być wykonane ze specjalnych materiałów o najwyższej jakości, które zapewnią bezpieczeństwo podczas takich prac jak spawanie czy lutowanie na twardo. Okulary ochronne do korekcji przeznaczone są dla osób, które potrzebują ochrony oczu z jednoczesną funkcją korekcji wady wzroku. Okulary ochronne korekcyjne to z jednej strony zapewnienie właściwej widoczności podczas wykonywania obowiązków, a z drugiej ochrona przed zagrożeniami na stanowisku pracy.','','product-290','','','','Okulary ochronne Infield z możliwością korekcji','','','',''),
(2051,1,1,'Okulary ochronne z możliwością korekcji Uniwersalne okulary ochronne wyposażone w zintegrowane, transparentne osłony po obu zewnętrznych stronach, zauszniki z metalowym wkładem dla łatwego dopasowania oraz z otworem do taśmy okularowej.  Okulary posiadają bezbarwne soczewki utwardzone wykonane z poliwęglanu. Odpowiednie przy spawaniu, dmuchaniu szkła, przelewaniu płynów o dużych temperaturach i podczas pracy przy piecach hutniczych. Możliwość montażu szkieł korekcyjnych.   99,5% ochrona UV do 370nm','','product-289','','','','Okulary ochronne Honeywell z możliwością korekcji','','','',''),
