(2105,1,1,'Opaska na głowę Opaska odpowiednia do modelu ProX  Chroni okulary przed upadkiem Pomaga utrzymać okulary na pozycji Posiada stoper - regulację długości Opaskę montuje się dzięki specjalnie zaprojektowanym zamkom','','product-214','','','','LEADER ProX opaska na głowę do okularów sportowych','','','',''),
(2106,1,1,'Wkładka korekcyjna z bazą 6 do okularów Leader Trail, służy do montażu soczewek korekcyjnych w celu aktywnego korzystania z okularów sportowych przez osoby z wadą wzroku.  Wkładkę korekcyjną montuje się w okularach za pomocą zatrzasku. Wystarczy wsunąć wkładkę w szczelinę w okularach i gotowe. Dzięki mocnemu połączeniu z okularami wkładka pozostaje na swoim miejscu nawet przy wzmożonej aktywności np. jeździe górskiej na rowerze, bieganiu przełajowym. Przeznaczona do indywidualnego montażu soczewek korekcyjnych od +/- 4,0 dpt. z cyl. +/-2,0 dpt.','','product-198','','','','LEADER TRAIL wkładka korekcyjna do okularów sportowych','','','',''),
